#include <bits/stdc++.h>

using namespace std;

int main() {
  int n;
  cin >> n;
  
  bitset<1'000'000> primes{""};


  
  int count = 0;
  
  while (n >= 4) {
		for (int i = 1; i <= n / 2; i++) {
			if (primes[i - 1] && primes[n - i - 1]) {
				n = (n - i) - i;
				count++;
				break;
			}
		}
  }
  cout << count << endl;
  return 0;
}
